-- \c capstone_one

DROP TABLE IF EXISTS cards;

CREATE TABLE cards
(
  _id TEXT PRIMARY KEY,
  title TEXT NOT NULL,
  original_title TEXT,
  fee INTEGER,
  url TEXT,
  foreign_fee BOOLEAN,
  image TEXT,  
  reward_type_id INTEGER REFERENCES reward_types (id) ON DELETE SET NULL,
  bank_id TEXT REFERENCES banks (_id) ON DELETE CASCADE,
  signup_bonus_id INTEGER REFERENCES signup_bonus (id) ON DELETE SET NULL
);

